import React, { useState, useEffect } from "react";

function Contacts({ contacts, currentUser }) {
  const [currentUserName, setCurrentUserName] = useState(undefined);
  const [currentUserIcon, setCurrentUserIcon] = useState(undefined);
  const [currentSelected, setCurrentSelected] = useState(undefined);
  useEffect(() => {
    if (currentUser !== undefined) {
      setCurrentUserName(currentUser.username);
      setCurrentUserName(currentUser.iconImage);
    }
  }, [currentUser]);

  const changeCurrentContacts = (index, chat) => {};

  return (
    <>
      {currentUserIcon && currentUserName && (
        <div className="contacts-body">
          <div className="brand">
            <img src="" alt="" />
            <h3>Typee</h3>
          </div>
          <div className="contacts">
            {contacts.map((contact, index) => {
              <div
                className={`contact${
                  index === currentSelected ? "-selected" : ""
                } `}
                key={index}
              >
                <div className="icon">
                  <img
                    src={`data:image/svg+xml;base64,${contact.iconImage}`}
                    alt="Icon"
                    // onClick={() => setSelectedIcon(index)}
                  />
                </div>
                <div className="username">
                  <h3>{contact.username}</h3>
                </div>
              </div>;
            })}
          </div>
        </div>
      )}
    </>
  );
}

export default Contacts;
